// this line should not be removed
var wRestaurants = angular.module("wRestaurants",[]);

wRestaurants.controller( "wRestaurantsController", function( $scope ) {
	 $.get("http://ipinfo.io", function(response) {

    $scope.$apply(function() {
        $scope.cit=response.city;
        $scope.zip=response.postal;
    });    
    }, "jsonp").done(function(){
    var dq = new DataQuery( 'qOrderIn' );
    dq.setParameters({"zip":$scope.zip});
    	dq.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.results = dq.getData().slice(0,10);
    		});
    	});
});
    $scope.reserve = function(url){
        var win = window.open(url, '_blank');
        win.focus();
    };
});
